import React, { Component } from "react";
import { Image, Segment } from "semantic-ui-react";
import { withTranslation } from "react-i18next";
import { imageUrl } from "./config";
class openMarket extends Component {
  render() {
    const language = localStorage.getItem("i18nextLng");
    const { t } = this.props;
    return (
      <div>
        <Segment className={`generalSection ${language}`}>
          <Image
            src={`${imageUrl}/landing-page/openMarketbackground@3x.png`}
            className="backgroundImg"
            loading="lazy"
          />
          <Image
            src={`${imageUrl}/landing-page/Open%20Market@3x-min.png`}
            className="ImgStyle"
            loading="lazy"
          />
        </Segment>
        <Segment className={`OpenMarketSection ${language}`}>
          <h4> {t("landingPage:openMarketMainTitle")} </h4>
          <span> {t("landingPage:openMarketSubTitle")} </span>
          <p>{t("landingPage:openMarketPragraph")}</p>

          <h4 className="OpenMarketchild"> {t("landingPage:fairCompetitionMainTitle")} </h4>
          <span> {t("landingPage:fairCompetitionSubTitle")} </span>
          <p>{t("landingPage:fairCompetitionPragraph")}</p>

          <h4 className="OpenMarketchild"> {t("landingPage:conditionalFeesMainTitle")} </h4>
          <span> {t("landingPage:conditionalFeesSubTitle")} </span>
          <p>{t("landingPage:conditionalFeesPragraph")}</p>
        </Segment>
      </div>
    );
  }
}
export default withTranslation("landingPage")(openMarket);
